        public Creature Copy(
            Creature_CopyMask copyMask = null,
            Creature def = null)
        {
            return Creature.Copy(
                this,
                copyMask: copyMask,
                def: def);
        }

        public static Creature Copy(
            Creature item,
            Creature_CopyMask copyMask = null,
            Creature def = null)
        {
            Creature ret;
            if (item.GetType().Equals(typeof(Creature)))
            {
                ret = new Creature();
            }
            else
            {
                ret = (Creature)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

        public static Creature Copy_ToLoqui(
            Creature item,
            Creature_CopyMask copyMask = null,
            Creature def = null)
        {
            Creature ret;
            if (item.GetType().Equals(typeof(Creature)))
            {
                ret = new Creature() as Creature;
            }
            else
            {
                ret = (Creature)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

