    #region Xml Write Mixins
    public static class CreatureXmlTranslationMixIn
    {
        public static void WriteToXml(
            this ICreatureInternalGetter item,
            XElement node,
            out Creature_ErrorMask errorMask,
            bool doMasks = true,
            Creature_TranslationMask translationMask = null,
            string name = null)
        {
            ErrorMaskBuilder errorMaskBuilder = doMasks ? new ErrorMaskBuilder() : null;
            ((CreatureXmlWriteTranslation)item.XmlWriteTranslator).Write(
                item: item,
                name: name,
                node: node,
                errorMask: errorMaskBuilder,
                translationMask: translationMask?.GetCrystal());
            errorMask = Creature_ErrorMask.Factory(errorMaskBuilder);
        }

        public static void WriteToXml(
            this ICreatureInternalGetter item,
            string path,
            out Creature_ErrorMask errorMask,
            Creature_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().SaveIfChanged(path);
        }

        public static void WriteToXml(
            this ICreatureInternalGetter item,
            Stream stream,
            out Creature_ErrorMask errorMask,
            Creature_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().Save(stream);
        }

    }
